--- Trigger kích hoạt khi thêm chi tiết hoá đơn
CREATE TRIGGER trg_ThemChiTietHoaDon
ON ChiTietHoaDon
AFTER INSERT
AS BEGIN	
	declare @SanPhamID AS nvarchar(255), @SoLuongLayDi AS int
	SET @SanPhamID = (SELECT SanPhamID FROM inserted)
	SET @SoLuongLayDi = (SELECT SoLuong FROM inserted)
	IF 'DA_XU_LY' = (SELECT TrangThai FROM HoaDon WHERE HoaDonID =  (SELECT HoaDonID FROM inserted))
	BEGIN
		UPDATE SanPham SET SoLuongTon = SoLuongTon - @SoLuongLayDi
		WHERE @SanPhamID = SanPhamID
	END
END
GO


--- Trigger kích hoạt khi dùng khuyến mãi
CREATE TRIGGER trg_ThemHoaDon
ON HoaDon
AFTER INSERT
AS BEGIN	
	declare @KhuyenMaiID AS nvarchar(255)
	SET @KhuyenMaiID = (SELECT CodeKhuyenMai FROM inserted)
	IF 'DA_XU_LY' = (SELECT TrangThai FROM HoaDon WHERE HoaDonID = (SELECT HoaDonID FROM inserted))
	BEGIN
		IF (@KhuyenMaiID != 'NO_APPLY')
			BEGIN
				UPDATE KhuyenMai SET SoLuotDaApDung += 1
				WHERE @KhuyenMaiID = CodeKhuyenMai AND SoLuotDaApDung + 1 <= SoLuongKhuyenMai
		END
	END
END
GO


